    <style type="text/css">
        .form-style-4 {
            width: 450px;
            font-size: 16px;
            padding: 30px 30px 15px 30px;
        }

        .form-style-4 button[type=submit],
        .form-style-4 button[type=button],
        .form-style-4 input[type=text],
        .form-style-4 input[type=email],
        .form-style-4 textarea,
        .form-style-4 label {
            font-family: Georgia, "Times New Roman", Times, serif;
            font-size: 16px;
            color: #8d6dff;

        }

        .form-style-4 label {
            display: block;
            margin-bottom: 10px;
        }

        .form-style-4 label>span {
            display: inline-block;
            width: 150px;
        }

        .form-style-4 input[type=text],
        .form-style-4 input[type=email] {
            background: transparent;
            border: none;
            border-bottom: 1px dashed #8d6dff;
            border-color: #8d6dff;
            width: 275px;
            outline: none;
            padding: 0px 0px 0px 0px;
            font-style: italic;
        }

        .form-style-4 textarea {
            font-style: italic;
            padding: 0px 0px 0px 0px;
            background: transparent;
            outline: none;
            border: none;
            border-bottom: 1px dashed #8d6dff;
            border-color: #8d6dff;
            width: 275px;
            overflow: hidden;
            resize: none;
            height: 20px;
        }

        .form-style-4 textarea:focus,
        .form-style-4 input[type=text]:focus,
        .form-style-4 input[type=email]:focus,
        .form-style-4 input[type=email] :focus {
            border-bottom: 1px dashed #D9FFA9;
            border-color: #8d6dff;
        }

        .form-style-4 button[type=submit],
        .form-style-4 button[type=button] {
            background: transparent;
            border-color: #8d6dff;
            padding: 8px 10px 8px 10px;
            border-radius: 20px;
        }

        .form-style-4 button[type=submit]:hover,
        .form-style-4 button[type=button]:hover {
            background: #8d6dff;
            color: #fff;
        }

        #message-button .title {
            background: transparent;
            border-color: #8d6dff;
            color: #fff;
            padding: 8px 10px 8px 10px;
            border-radius: 20px;
        }

        #message-button .title:hover {
            background-color: #8d6dff;
            color: #fff;
        }
    </style>
